import axios from 'axios';

export const addDiary = (newDiary) => {
    return (dispatch, getState) => {
        axios
        .post("http://localhost:3001/diaries/new", newDiary)
        .then(newDiary => {
            dispatch({
                type: "ADD_DIARY",
                newDiary
            })
        })
        .catch(error => {
            console.log(error.response)
        })
    }
}
